import React from 'react';

import './HowItWorks.css';
import Grid from '@material-ui/core/Grid';
const howItWorks = (props) => (
<div>
    <Grid container>
        <Grid item xs={2}></Grid>
<Grid item xs={10}><h2>{props.h2}</h2></Grid>
    </Grid>

    <Grid container classname="how1">
        <Grid item xs={2}></Grid>
    </Grid></div>
  

);

export default howItWorks;
